import React from "react";
import "./styles.css";

function Card(props) {
  return (
    <div
      className={`card ${props.alignment}`}
      key={props.uniqueKey}
      style={{ float: props.alignment }}
    >
      <div style="width:480px">
        <iframe
          allow="fullscreen"
          height="320"
          src="https://giphy.com/embed/u2wg2uXJbHzkXkPphr/video"
          width="480"
        ></iframe>
      </div>
      <h2 className="name">{props.name}</h2>
    </div>
  );
}

export default Card;
